import { Card, CardMedia, CardContent, Typography, Button } from "@mui/material";
import { Link } from "react-router-dom";

function CarCard({ car }) {
  return (
    <Card sx={{ width: 270, background: "#1e293b", color: "white" }}>
      <CardMedia
        component="img"
        height="150"
        image={car.image}
        alt={car.name}
      />
      <CardContent>
        <Typography variant="h6">
          {car.brand} {car.name}
        </Typography>
        <Typography variant="body2" color="gray">
          {car.model} â€¢ {car.year} â€¢ {car.seats} Seats
        </Typography>
        <Typography sx={{ mt: 1 }}>
          <b>â‚¹ {car.pricePerDay}</b> / day
        </Typography>

        <Button
          variant="contained"
          sx={{ mt: 2, width: "100%" }}
          component={Link}
          to={`/cars/${car.id}`}   // ðŸ‘ˆ navigate to details page
        >
          View Details
        </Button>
      </CardContent>
    </Card>
  );
}

export default CarCard;
